import SocialFeedCard from './socialFeedCard';
import Dropdown from './Dropdown';
import './projects.css';

function project(){

  useEffect(() => {
      console.log('EFFECT RUNNING');

      return () => {
        console.log('EFFECT CLEANUP');
      };
